e set to start at the specified times. The default behavior is to include the entire days.'=>'Daten, die mit start_date/end_date, starts_*/ends_* gesetzt werden, werden zu den angegebenen Zeiten beginnen. Das vorgegebene Verhalten ist, die kompletten Tage mit einzuschliessen.','Events that end after the specified date'=>'Veranstaltungen, die nach dem angegebenen Datum enden','Events that end before the specified date'=>'Veranstaltungen, die vor dem angegebenen Datum enden','Events that end on the specified date'=>'Veranstaltungen, die am angegebenen Datum enden','Events that start on the specified date'=>'Veranstaltungen, die am angegebenen Datum beginnen','Text label for control to hide restricted events on main calendar views.Hide restricted events on calendar views.'=>'Verstecke eingeschränkte Veranstaltungen in den Kalenderansichten.','The default text label for the "today" button on main calendar views.Today'=>'Heute','CSV File Formatting and Examples '=>'CSV-Dateiformatierung und Beispiele ','Importing Calendar Data From a CSV File'=>'Importieren von Kalenderdaten aus einer CSV-Datei','Need assistance? You can find more information here:'=>'Brauchst Du Unterstützung? Weitere Informationen findest Du hier:','To complete this major calendar upgrade, you need to migrate your events to the new data storage system. Once migration finishes, you can take advantage of all the cool new 6.0 features!'=>'Um dieses große Kalender-Upgrade abzuschließen, musst Du Deine Veranstaltungen auf das neue Datenspeichersystem migrieren. Sobald die Migration abgeschlossen ist, kannst Du alle coolen neuen Funktionen von 6.0 nutzen!','One more thing left to do...'=>'Es bleibt nur noch eines zu tun…','The Events Calendar: Custom Tables v1 - error'=>'Der Veranstaltungskalender: Benutzerdefinierte Tabellen v1 - Fehler','Automatic imports will be paused until migration is complete.'=>'Automatischer Import wurde angehalten bis die Migration durchgeführt wurde.','Event submissions will be 