t. Sobald Du die problematischen Veranstaltungen aktualisiert oder entfernt hast, führe bitte die Migrationsvorschau erneut durch.','Migration help'=>'Hilfe zur Migration','Unknown strategy applied to this event.'=>'Unbekannte Strategie für dieses Veranstaltung.','The following %1$s have been migrated with no adjustments:'=>'Die folgenden %1$s sind ohne Anpassungen migriert worden:','The following %1$s will be migrated with no adjustments:'=>'Die folgenden %1$s werden ohne Anpassungen migriert:','Events can migrate with no changes!'=>'Veranstaltungen können ohne Änderungen migriert werden!','We are reversing your site\'s migration to the new system. During this time, %1$syou cannot create, edit, or manage your events%2$s. Your calendar will still be visible on your site but some frontend actions will be paused.'=>'Wir machen die Umstellung deiner Seite auf das neue System rückgängig. Während dieser Zeit kannst Du %1$s keine Veranstaltungen erstellen, bearbeiten oder verwalten%2$s. Dein Kalender wird weiterhin auf deiner Seite sichtbar sein, aber einige Frontend-Aktionen werden pausiert.','Reverse migration in progress'=>'Rückgängigmachung der Migration im Gange','Reverse migration complete.'=>'Rückgängigmachung der Migration abgeschlossen.','Cancelation complete.'=>'Abbruch erfolgreich.','We are canceling your site\'s migration to the new system. During this time, %1$syou cannot create, edit, or manage your events%2$s. Your calendar will still be visible on your site but some frontend actions will be paused.'=>'Wir brechen die Migration deiner Seite auf das neue System ab. Während dieser Zeit kannst Du %1$skeine Veranstaltungen erstellen, bearbeiten oder verwalten%2$s. Dein Kalender wird weiterhin auf deiner Website sichtbar sein, aber einige Frontend-Aktionen werden pausiert.','Cancelation in progress'=>'Abbruch in Arbeit','Reverse migration'=>'Migration rückgängig machen','Total events migrated:'=>'Anzahl migrierter Veranstaltungen:','Migration completed'=>'Migration abgeschlossen','Your site is now using the upgraded event data storage system. Go ahead and %1$scheck out your events%2$s or %3$sview your calendar.%2$s'=>'Deine Website verwendet jetzt das aktualisierte System zur Speicherung von Veranstaltungsdaten. Mach weiter und %1$sschaue Dir Deine Veranstaltungen%2$s oder %3$s deinen Kalender an.%2$s','Migration complete!'=>'Migration abgeschlossen!','Cancel Migration Preview'=>'Migrationsvorschau abbrechen','Retry'=>'Wiederholen','Cancel Migration'=>'Migration abbrechen','Your events are being migrated to the new system. During migration, %1$syou cannot make changes to your calendar or events.%2$s Your calendar will still be visible on the frontend.'=>'Deine Veranstaltungen werden in das neue System migriert. Während der Migration kannst Du %1$skeine Änderungen an deinem Kalender oder deinen Veranstaltungen vornehmen.%2$s Dein Kalender ist weiterhin im Frontend sichtbar.','Migration in progress'=>'Migration wird durchgeführt','(Estimated time: %1$s minutes)'=>'(Geschätzte Dauer: %1$s Minuten)','(Estimated time: %1$s minute)'=>'(Geschätzte Zeit: %1$s Minuten)','Start migration'=>'Migration starten','Total events previewed:'=>'Anzahl Veranstaltungen Vorschau:','Preview completed'=>'Vorschau abgeschlossen','Your system doesn\'t allow us to run a preview, but you can still try a migration. During migration, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Dein System erlaubt uns nicht, eine Vorschau auszuführen, aber Du kannst trotzdem eine Migration versuchen. Während der Migration %1$skannst Du keine Veranstaltungen erstellen, bearbeiten oder verwalten.%2$s Dein Kalender ist weiterhin auf der Website sichtbar.','From this preview, we estimate that the full migration process will take approximately %3$d minutes. During this time, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Anhand dieser Vorschau schätzen wir, dass der gesamte Migrationsprozess etwa %3$d Minuten dauern wird. Während dieser Zeit %1$skannst Du keine Veranstaltungen erstellen, bearbeiten oder verwalten.%2$s Dein Kalender ist aber weiterhin auf deiner Website sichtbar.','The migration preview is done and ready for your review. No changes have been made to your events, but this report shows what adjustments will be made during the migration to the new system. If you have any questions, please %1$sreach out to our support team%2$s.'=>'Die Migrationsvorschau ist fertig und bereit für Deine Überprüfung. Es wurden keine Änderungen an deinen Veranstaltungen vorgenommen, aber dieser Bericht zeigt, welche Anpassungen während der Migration zum neuen System vorgenommen werden. Wenn Du Fragen hast, wende dich bitte %1$san unser Support-Team%2$s.','Preview complete'=>'Vorschau abgeschlossen','We\'re scanning your existing events so you\'ll know what to expect from the migration process. You can keep using your site and managing events. Check back later for the next step of migration.'=>'Wir scannen die existierenden Veranstaltungen, damit Du weißt, was Dich bei der Migration erwartet. Du kannst Deine Website weiter nutzen und Veranstaltungen verwalten. Schau später für den nächsten Schritt der Migration wieder vorbei.','Migration preview in progress'=>'Migrationsvorschau in Arbeit','Start migration preview'=>'Migrationsvorschau starten','Learn more about the migration'=>'Erfahre mehr über die Migration','https://evnt.is/1b79'=>'https://evnt.is/1b79','We\'ll scan your events and let you know how long your migration will take. The preview runs in the background, so you\'ll be able to continue using your site.'=>'Wir scannen Deine Veranstaltungen und teilen Dir mit, wie lange Deine Migration dauern wird. Die Vorschau läuft im Hintergrund, sodass Du Deine Website weiter nutzen kannst.','Ready to go? The first step is a migration preview.'=>'Können wir loslegen? Der erste Schritt ist eine Migrationsvorschau.','We\'ve completely revamped the way event information is stored on your site\'s database. Upgrade now to take advantage of faster calendar load times and improved performance. As with any significant site change, we recommend %screating a site backup%s before beginning the migration process.'=>'Wir haben die Art und Weise, wie Veranstaltungesinformationen in der Datenbank Deiner Website gespeichert werden, komplett überarbeitet. Führe jetzt ein Upgrade durch, um von schnelleren Kalenderladezeiten und verbesserter Leistung zu profitieren. Wie bei jeder wesentlichen Website-Änderung empfehlen wir, %seine Website-Sicherung zu erstellen%s, bevor Du mit dem Migrationsprozess beginnst.','Upgrade your event data storage system.'=>'Rüste dein System zur Speicherung von Veranstaltungsdaten auf.','Get ready for the new recurring events!'=>'Mache Dich bereit für die neuen wiederkehrenden Veranstaltungen!','Are you sure you want to reverse the recurring event system migration process?

- You will no longer be able to use the new recurring event and Series features.
- All event edits you have made since migration will be lost.
- As with migration, you will not be able to edit events or calendar options during this process and some frontend actions will be paused.
- Reverse migration should take less time than the original migration, but there is no time estimate available.
'=>'Möchtest Du den Systemmigrationsprozess für wiederkehrende Veranstaltungen wirklich rückgängig machen?

- Du kannst die neuen Funktionen für wiederkehrende Veranstaltungen und Serien nicht mehr verwenden.
- Alle Veranstaltungsbearbeitungen, die seit der Migration vorgenommen wurden, gehen verloren.
- Wie bei der Migration kannst Du während dieses Vorgangs keine Veranstaltungen oder Kalenderoptionen bearbeiten, und einige Frontend-Aktionen werden angehalten.
- Die umgekehrte Migration sollte weniger Zeit in Anspruch nehmen als die ursprüngliche Migration, es ist jedoch keine Zeitschätzung verfügbar.
