rch and options bar that appears above calendar views.'=>'Diese Einstellungen beeinflussen die Such- und Optionsleiste oben bei den Kalenderaufrufen.','Events Bar'=>'Veranstaltungsleiste','News from The Events Calendar'=>'Neuigkeiten von dem Events Kalender','Effortlessly fill your calendar with events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Fülle Deinen Kalender mühelos mit Veranstaltungen von Meetup, Eventbrite, iCal, Google Calendar und mehr.','Import events with ease'=>'Einfaches Importieren von Veranstaltungen','Events Aggregator'=>'Veranstaltungs-Aggregator','The Events Calendar does not send any user data outside of your website by default.'=>'The Events Calendar versendet standardmäßig keine Benutzerdaten außerhalb deiner Website.','Create Eventbrite tickets and events right from your WordPress dashboard.'=>'Erstelle Eventbrite-Karten und Veranstaltungen direkt aus deinem WordPress-Dashboard.','Enable 3rd party event submissions.'=>'Aktiviere Veranstaltungseinreichungen von Dritten.','Allow users to search for events by category, tag, venue, organizer, day of the week, time of day, and price.'=>'Ermöglicht den Benutzern die Suche nach Veranstaltungen bezogen auf Kategorie, Schlagwort, Veranstaltungsort, Veranstalter, Wochentag, Tageszeit und Preis.','Email marketing to promote your events'=>'E-Mail-Marketing zur Bewerbung Deiner Veranstaltungen','Collect RSVPs and sell tickets'=>'Reservierungen sammeln und Tickets verkaufen','Import events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Importiere Veranstaltungen von Meetup, Eventbrite, iCal, Google Calendar und anderen.','The #1 calendar for WordPress'=>'Die Nummer 1 unter den Kalendern für WordPress','There are a few %s to resolve and prevent 404 errors.'=>'Es gibt ein paar %s, um 404-Fehler zu beheben und zu vermeiden.','I keep getting “Page Not Found” on events.'=>'Ich erhalte ständig die Meldung "Seite nicht gefunden" bei Veranstaltungen.','%s and other common installation issues.'=>'%s und andere häufige Installationsprobleme.','I installed the calendar and it crashed my site.'=>'Ich habe den Kalender installiert, und er hat meine Website zum Absturz gebracht.','This can happen when other plugins try to improve performance. %s.'=>'Dies kann passieren, wenn andere Plugins versuchen, die Leistung zu verbessern. %s.','My calendar doesn’t look right.'=>'Mein Kalender sieht nicht korrekt aus.','Here’s an overview of %s and what they mean.'=>'Hier findest Du einen Überblick über %s und ihre Bedeutung.','Common Error Messages'=>'Allgemeine Fehlermeldungen','Check for updates'=>'Auf Aktualisierungen überprüfen','It\'s important to use the most recent versions of our plugins so that you have access to the latest features, bug fixes, and security updates. Plugin functionality can be comprimised if your site is running outdated or mis-matched versions.'=>'Es ist wichtig, die neuesten Versionen unserer Plugins zu verwenden, damit Du Zugang zu den neuesten Funktionen, Fehlerbehebungen und Sicherheitsupdates hast. Die Plugin-Funktionalität kann beeinträchtigt werden, wenn auf deiner Website veraltete oder falsch angepasste Versionen verwendet werden.','Plugin(s) are out of date'=>'Erweiterungen sind nicht aktuell','Enter a custom API key'=>'Eigenen API Schlüssel eintragen','The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins, dynamic map loads, or Events Calendar Pro\'s Location Search and advanced Map View, you’ll need to get your own Google Maps API key and add it to Events > Settings > Integrations'=>'The Events Calendar wird mit einem API-Schlüssel für grundlegende Kartenfunktionen geliefert. Wenn Du erweiterte Funktionen wie benutzerdefinierte Kartennadeln, dynamisches Laden von Karten oder die Standortsuche und die erweiterte Kartenansicht von Events Calendar Pro nutzen möchtest, musst Du einen eigenen Google Maps-API-Schlüssel erhalten und ihn unter Events > Einstellungen > Integrationen hinzufügen','Default Google Maps API key'=>'Standard Google Maps API Schlüssel','Manage your licenses'=>'Lizenzen verwalten','License keys can only be used on a limited number of sites, which varies depending on your license level. You\'ll need to remove the license from one or more other site\'s in order to use it on this one.'=>'Lizenz-Schlüssel können nur auf einer begrenzten Anzahl von Websites verwendet werden, die je nach Lizenzstufe variiert. Du musst die Lizenz von einer oder mehreren anderen Websites entfernen, um sie auf dieser Website verwenden zu können.','Install max has been reached'=>'Installationsmaximum ist erreicht','Adjust your timezone'=>'Zeitzone anpassen','When using The Events Calendar, we highly recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “UTC+9”. Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. Go to your the General WordPress settings to adjust your site timezone.'=>'Wenn Du The Events Calendar verwendest, empfehlen wir dringend, dass Du eine geografische Zeitzone wie "America/Los_Angeles" verwendest und einen UTC-Zeitzonenversatz wie "UTC+9" vermeidest. Die Wahl einer UTC-Zeitzone für Deine Website oder einzelne Veranstaltungen kann zu Problemen beim Import von Veranstaltungen oder mit der Sommerzeit führen. Gehe zu den allgemeinen WordPress-Einstellungen, um die Zeitzone für Deine Website anzupassen.','Site time zone uses UTC'=>'Website Zeitzone verwendet UTC','Display Custom HTML'=>'Benutzerdefiniertes HTML anzeigen','Hide Others’ Organizers and Venues'=>'Andere Veranstalter und Veranstaltungsorte ausblenden','This extension adds the “Show Google Maps” and “Show Google Maps Link” checkboxes when creating a new Venue.'=>'Diese Erweiterung fügt die Kontrollkästchen "Google Maps anzeigen" und "Google Maps Link anzeigen" hinzu, wenn Du einen neuen Veranstaltungsort erstellst.','Add Google Maps Display and Link Options'=>'Google Maps Anzeige- und Link-Optionen hinzufügen','This extension allows you to set default currency symbols for your users to choose from instead of having a plain text field.'=>'Diese Erweiterung ermöglicht es Dir, Standard-Währungssymbole festzulegen, aus denen Deine Benutzer wählen können, anstatt ein reines Textfeld zu haben.','Add Cost Currency Symbol'=>'Währungssymbol hinzufügen','This extension will send an email to event organizers whenever a user registers for their event.'=>'Diese Erweiterung sendet eine E-Mail an die Veranstalter von Veranstaltungen, wenn sich ein Benutzer für ihre Veranstaltung anmeldet.','Organizer Notification Email'=>'E-Mail-Benachrichtigung des Veranstalters','Displays the information collected by “attendee meta fields” in the WooCommerce order screens as well.'=>'Zeigt die durch "Teilnehmer-Meta-Felder" erfassten Informationen auch in den WooCommerce-Bestellbildschirmen an.','Add Event & Attendee Info to WooCommerce Order Details'=>'Hinzufügen von Veranstaltungs- und Teilnehmerinformationen zu WooCommerce-Bestelldetails','This extension shows a meta box with an API key on each Event with Ticket/RSVP.'=>'Diese Erweiterung zeigt bei jedem Event mit Ticket/Reservierung eine Meta-Box mit einem API-Schlüssel an.','Per Event Check In API'=>'API pro Veranstaltung Check In','Adds a new settings panel in Events > Settings that gives more control over the ticket and rsvp emails that are sent to attendees after registration.'=>'Fügt ein neues Einstellungsfeld unter Veranstaltungen > Einstellungen hinzu, das mehr Kontrolle über die Ticket- und Antwort-E-Mails bietet, die nach der Registrierung an die Teilnehmer gesendet werden.','Ticket Email Settings'=>'Ticket-E-Mail-Einstellungen','When it comes to paid tickets, these orders can be refunded through the e-commerce platform in use.'=>'Wenn es sich um bezahlte Tickets handelt, können diese Bestellungen über die genutzte E-Commerce-Plattform erstattet werden.','How do I process refunds for tickets?'=>'Wie bearbeite ich Erstattungen für Tickets?','Yes! You can easily accomplish this task using the stock options and multiple ticket types available with Event Tickets.'=>'Ja! Du kannst diese Aufgabe ganz einfach erledigen, indem Du die Bestandsoptionen und die verschiedenen Ticketarten nutzt, die bei Event Tickets verfügbar sind.','Can I have a seating chart associated with my tickets?'=>'Kann ich einen Sitzplan zu meinen Tickets erhalten?','You can sell tickets using our built-in e-commerce option, or upgrade to Event Tickets Plus to use ecommerce plugins such as WooCommerce.'=>'Du kannst Tickets über unsere integrierte E-Commerce-Option verkaufen oder ein Upgrade auf Event Tickets Plus durchführen, um E-Commerce-Plugins wie WooCommerce zu verwenden.','How Do I Set Up E-Commerce Plugins for Selling Tickets?'=>'Wie richte ich E-Commerce-Plugins für den Verkauf von Tickets ein?','We’ve put together a video tutorial showing how to create events with Tickets using our plugins. Click on the link in the link in the title to learn more.'=>'Wir haben ein Video-Tutorial zusammengestellt, das zeigt, wie man mit unseren Plugins Veranstaltungen mit Tickets erstellt. Klicke auf den Link im Titel, um mehr zu erfahren.','How Do I create events with Tickets or RSVP’s?'=>'Wie kann ich Veranstaltungstickets oder Reservierungen erstellen?','This extension is a collection of tweaks and snippets for The Events Calendar.'=>'Diese Erweiterung ist eine Sammlung von Tweaks und Snippets für The Events Calendar.','The Events Calendar Tweaks'=>'Überarbeitung von The Events Calendar ','This extension replaces photo view with a tiled grid of cards featuring event images.'=>'Diese Erweiterung ersetzt die Fotoansicht durch ein gekacheltes Raster von Karten mit Veranstaltungsbildern.','Alternative photo view'=>'Alternative Fotoansicht','This extension adds a set of block patterns for events to the WordPress block editor