informationen automatisch an das Support-Team von The Events Calendar weitergeben*','Please opt-in below to automatically share your system information with our support team. This will allow us to assist you faster if you post in our help desk.'=>'Bitte melde Dich unten an, um Deine Systeminformationen automatisch an unser Support-Team weiterzugeben. So können wir Dir schneller helfen, wenn Du eine Anfrage an unseren Helpdesk stellst.','Open a ticket'=>'Ticket aufmachen','Included with our premium products'=>'Bei unseren Premium-Produkten inbegriffen','Get support from humans'=>'Unterstützung von Menschen erhalten','Recent template changes'=>'Letzte Änderungen des Templates','Hey there... did you check out the %s'=>'Hallo... hast Du die %s','Help page?'=>'Hilfe Seite?','Sometimes things just don’t work as expected. We’ve created a wealth of resources to get you back on track.'=>'Gelegentlich treten unerwartete Probleme auf, die dazu führen, dass Dinge nicht wie geplant funktionieren. Für diesen Fall haben wir eine Vielzahl an Ressourcen zusammengestellt, um dir zu helfen, das Problem zu beheben.','Troubleshooting'=>'Problembehandlung','Providing the details of your calendar plugin and settings (located below) helps our support team troubleshoot an issue faster. %s'=>'Die Angabe der Details zu deinem Kalender-Plugin und den Einstellungen (siehe unten) hilft unserem Support-Team, ein Problem schneller zu beheben. %s','Share your system info'=>'Teile Deine Systeminformationen','Most issues are caused by conflicts with the theme or other plugins. Follow these steps as a first point of action. %s'=>'Die meisten Probleme werden durch Konflikte mit dem Theme oder anderen Plugins verursacht. Befolge als erste Maßnahme die folgenden Schritte. %s','View article'=>'Beitrag anzeigen','Test for conflicts'=>'Teste auf Konflikte','First Steps'=>'Erste Schritte','Event log'=>'Veranstaltungsprotokoll','License & Usage'=>'Lizenzen & Nutzung','Event Aggregator system status '=>'Event 