This is an invitation to help our %2$s community. If you opt-in, some data about your usage of %2$s will be shared with our teams (so they can work their butts off to improve). We will also share some helpful info on events management, WordPress, and our products from time to time.'=>'Hallo,%1$s! Dies ist eine Einladung, unserer %2$s Community zu helfen. Wenn Du Dich anmeldst, werden einige Daten über Deine Verwendung von %2$s an unsere Teams weitergegeben (damit sie das Produkt verbessern können). Von Zeit zu Zeit werden wir auch einige hilfreiche Informationen zu Event Management, WordPress und unseren Produkten veröffentlichen.','We hope you love %1$s'=>'Wir hoffen, Du magst %1$s','The associated field is required.( required )'=>'(erforderlich)','Terms'=>'Bedingungen','and'=>'und','Privacy'=>'Datenschutz','Promoter All rights reserved.'=>'Veranstalter Alle Rechte vorbehalten.','Authorize Promoter'=>'Autorisiere Promoter','Please authorize to continue onboarding.'=>'Autorisiere Dich bitte um weiterzumachen.','Sorry, unable to authenticate your site. Please contact Promoter support.'=>'Sorry, die Authentifizierung Deiner Website ist fehlgeschlagen. Bitte kontaktiere den Promoter.','Please log out and log back in as an admin account'=>'Bitte Abmelden und wieder anmelden als admin-Konto','You do not have access to authenticate this site.'=>'Du hast keinen Zugriff, um diese Website zu authentifizieren.','Please log in to continue'=>'Bitte melden Dich an, um fortzufahren','Promoter would like to sync with your site'=>'Promoter möchte sich mit deiner Website synchronisieren','Licenses for Multisites'=>'Lizenzen für Multisites','Expired license keys and subscriptions'=>'Abgelaufene Lizenzschlüssel und Abonnements','Moving your license keys'=>'Lizenzschlüssel verschieben','View and manage your license keys'=>'Anzeigen und verwalten von license keys','Why am I being told my license key is out of installs?'=>'Warum bin ich da gesagt, mein Lizenzschlüssel ist aus installiert?','Helpful Links:'=>'Hilfreiche Links:','In order to register a plugin license, you\'ll first need to %1$sdownload and install%2$s the plugin you purchased. You can download the latest version of your plugin(s) from %3$syour account\'s downloads page%4$s. Once the plugin is installed and activated on this site, the license key field will appear below.'=>'Um eine Plugin-Lizenz zu registrieren, musst Du diese zuerst %1$sdownloaden und dann das Plugin installieren%2$s. Du kannst die neueste Version Deines Plugins vom Downloadbereich %3$sDeines Kontos%4$s  herunterladen. Sobald das Plugin installiert und auf dieser Website aktiviert ist, erscheint unten das Feld Lizenzschlüssel.','If you\'ve purchased a premium add-on, you\'ll need to enter your license key here in order to have access to automatic updates when new versions are available.'=>'Wenn Du ein Premium-Add-On gekauft hast, musst Du hier Deinen Lizenzschlüssel eingeben, um auf automatische Updates zugreifen zu können, wenn neue Versionen verfügbar sind.','Select the date format used for elements with minimal space, such as in datepickers.'=>'Wähle das Datumsformat für Elemente mit minimalem Platzbedarf, z.B. in Datepickern.','Compact date format'=>'Kompaktes Datumsformat','North Macedonia'=>'Nordmazedonien','The Action Logger will dispatch any logging message using the "tribe_log" action writing, by default, to the PHP error log.'=>'Die Aktion Logger senden alle logging-Nachricht mit dem "tribe_log" Aktion schreiben, standardmäßig in das PHP-error-log.','Action-based Logger'=>'Aktions-basierter Logger','There’s a new version of %1$s available, but your license is expired. You’ll need to renew your license to get access to the latest version. If you plan to continue using your current version of the plugin(s), be sure to use a compatible version of The Events Calendar. %2$s'=>'Es gibt eine neue Version von %1$s, aber Deine Lizenz ist abgelaufen. Du musst Deine Lizenz verlängern, um Zugriff auf die neueste Version zu erhalten. Wenn Du planst, Deine aktuelle Version der Plugins weiterhin zu verwenden, stelle sicher, dass Du eine kompatible Version des Events Calendars verwendest. %2$s','Read more.'=>'Weiterlesen.','Promoter'=>'Veranstalter','%s must be a valid URL.'=>'%s muss eine gültige URL sein.','Your update failed due to an incompatibility between the version (%1$s) of the %2$s you tried to update to and the version of %3$s that you are using. %4$s'=>'Dein Update ist aufgrund einer Inkompatibilität zwischen der Version (%1$s) der %2$s, auf die du zu aktualisieren versucht hast, und der Version von %3$s, die du verwendest, fehlgeschlagen. %4$s','State'=>'Zustand','Writes'=>'Schreibt','Reads'=>'Liest','ORM arg'=>'ORM arg','Value'=>'Wert','Key'=>'Schlüssel','PHP Render Context'=>'PHP Render-Kontext','Could not delete post with ID '=>'Konnte nicht gelöscht werden, der post mit der ID ','Close this dialog window'=>'Dieses Dialogfenster schließen','Open the dialog window'=>'Dieses Dialogfenster öffnen','OK'=>'OK','Confirm'=>'Bestätigen','Close this modal window'=>'Modales Fenster schließen','Open the modal window'=>'Dieses modale Fenster schließen','Show Timezone'=>'Zeitzone anzeigen','Event Date & Time'=>'Datum und Uhrzeit der Veranstaltung','Event Categories'=>'Ereignis-Kategorien','Tags'=>'Schlagwörter','Event Venue'=>'Veranstaltungsort','Event Organizer'=>'Organisator Veranstaltung','All day'=>'Ganztägig','Show Map'=>'Zeige Karte','Enable Maps'=>'Aktiviere Karten','Show Map Link'=>'Kartenlink anzeigen','Show Map Link:'=>'Zeige Kartenlink:','Show Map:'=>'Zeige Karte:','Activate Block Editor for Events'=>'Den Blockeditor für Veranstaltungen aktivieren','Add Button Text'=>'Schaltflächen Text hinzufügen','Event Organizers'=>'Veranstalter','Unknown Column '=>'Unbekannte Spalte ','There was an error building the record queue: '=>'Beim Erstellen der Datensatzwarteschlange ist ein Fehler aufgetreten: ','(click here for details)'=>'(klicke hier für Details)','Event Blocks'=>'Event-Blocks','Add Description...'=>'Beschreibung hinzufügen...','F j'=>'j. F','F j, Y'=>'j. F Y','g:i a'=>'G:i','%s ago'=>'vor %s','%s from now'=>'in %s','Problem loading the block, please remove this block to restart.'=>'Problem beim Laden des Block. Bitte diesen Block entfernen, um zu starten.','Text Array'=>'Text Array','Numeric Array'=>'Numerisches Array','Show Custom Fields metabox'=>'Metabox für individuelle Felder anzeigen','Stop current processes'=>'Aktuelle Prozesse stoppen','The Asynchronous import process is faster and does not rely on WordPress Cron but might not work correctly in all WordPress installations, try switching to the Cron-based process for maximum compatibility.'=>'Der asynchrone Import-Prozess ist schneller und stützt sich nicht auf WordPress-Cron, funktioniert jedoch möglicherweise nicht korrekt in allen WordPress-Installationen. Versuchen die Umstellung auf den Cron-basierten Prozess für maximale Kompatibilität.','Import Process System'=>'Prozesssystem importieren','click here'=>'Klicke hier','If you want to stop and clear current asynchronous import processes %1$s.'=>'Wenn Du aktuelle asynchrone Importprozesse %1$s stoppen und löschen möchtest.','Import from Eventbrite URL'=>'Importiere von einer Eventbrite URL','to create your own free Google Maps API key.'=>'um einen eigenen kostenlosen Google Maps API-Schlüssel zu erstellen.','If you do not add your own API key, the built-in API key will always populate this field and some map-related functionality will be limited '=>'Wenn Du keinen eigenen API-Schlüssel hinzufügst, wird dieses Feld immer mit dem integrierten API-Schlüssel gefüllt und einige kartenbezogene Funktionen sind eingeschränkt ','You are using The Events Calendar\'s built-in Google Maps API key.'=>'Du verwendest den integrierten Google Maps-API-Schlüssel des Veranstaltungskalenders.','to learn more about using it with The Events Calendar'=>'um mehr über die Verwendung mit The Events Calendar zu erfahren','You are using a custom Google Maps API key.'=>'Du verwendest einen benutzerdefinierten Google Maps-API-Schlüssel. ','Cron-based'=>'Cron-basierte','Asynchronous'=>'Asynchron','Unsupported'=>'Kein Support','Successfully stopped and cleared 1 asynchronous queue process.'=>'Erfolgreich gestoppt und gelöscht 1 die asynchrone queue-Prozess.' . "\0" . 'Erfolgreich gestoppt und gelöscht %d asynchrone Warteschlange verarbeitet.','No asynchronous queue processes to clear.'=>'Keine asynchronen queue-Prozesse zu deaktivieren.','The event tag ID or name'=>'Die event-tag-ID oder name','The event category ID or name'=>'Die Kategorie-ID oder der Name der Veranstaltung','Events should be filtered by their post_parent being the specified one.'=>'Die Veranstaltungen sollten anhand ihres post_parent gefiltert werden.','Include events with one of the post IDs specified in the array of CSV list, date filters will be ignored.'=>'Schließe Veranstaltungen mit einer der im Array der CSV-Liste angegebenen Post-IDs ein. Datumsfilter werden ignoriert.','Unable to process this import - a breakage or conflict may have resulted in the import halting.'=>'Nicht in der Lage zu verarbeiten diese zu importieren - ein Bruch oder Konflikt kann dazu geführt haben, in den import ins stocken.','Calendar of %s'=>'Kalender von %s','%s Views Navigation'=>'%s Ansichten-Navigation','%s Search and Views Navigation'=>'%s Suche und Ansichten, Navigation','If you have extended our plugin(s) to send data to a third-party service such as Eventbrite, Google Maps, or PayPal, user information may be passed to these external services. These services may be located abroad.'=>'Wenn Du unsere Plugin(s) erweitert hast, um Daten an einen Drittanbieter-Dienst wie Eventbrite, Google Maps oder PayPal, Benutzer-Informationen zu senden, können Informationen von Nutzern an diese externen Dienste weitergegeben werden. Diese Dienste haben ihren Sitz möglicherweise im Ausland.','Where We Send Your Data'=>'Wohin wir Deine Daten senden','Certain data may be exported or removed upon users’ requests via the existing Exporter or Eraser. Please note, however, that several “edge cases” exist in which we are unable to perfect the gathering and export of all data for your end users. We suggest running a search in your local database, as well as within the WordPress Dashboard, in order to identify all data collected and stored for your specific user requests.'=>'Gewisse Daten können auf Anforderungen der Nutzer exportiert oder entfernt werden. Bitte beachte jedoch, dass es mehrere "Grenzfälle" gibt, in denen wir nicht perfekt das Sammeln und Exportieren aller Daten für die Endbenutzer durchführen können. Wir empfehlen eine Suche in der lokalen Datenbank als auch im WordPress-Dashboard, um alle Daten des Nutzers zu identifizieren, die erhobenen und gespeichert wurden.','All information (data) is retained in the local database indefinitely, unless otherwise deleted.'=>'Alle Informationen (Daten) beibehalten wird, die in der lokalen Datenbank auf unbestimmte Zeit, sofern nicht anderweitig gelöscht.','How Long You Retain this Data'=>'Wie lange Du diese Daten behalten willst','We make use of certain APIs, in order to provide specific features.'=>'Wir nutzen bestimmte API-keys, um bestimmte Funktionen anzubieten.','The Events Calendar suite offers the use of third-party API keys. The primary functions are to enhance the features we\'ve built in, some of which use Google Maps, PayPal, Eventbrite, and Meetup. These API keys are not supplied by The Events Calendar.'=>'Die Events Calendar Suite bietet die Nutzung von Third-Party-API-Schlüssel. Die primären Funktionen sind die Erweiterung der eingebauten Funktionen, von denen einige Google Maps, PayPal, Eventbrite, und Meetup verwenden. Diese API-Schlüssel sind nicht im Lieferumfang des Events Calendar enthalten.','API Keys'=>'API Schlüssel','When purchasing Eventbrite Tickets, attendee, purchaser, and order information are stored and managed by Eventbrite.'=>'Beim Kauf von Eventbrite Tickets werden Teilnehmer, Käufer und andere Bestelldaten gespeichert und von Eventbrite verwaltet.','Please note that to create new events through the Community Events submission form, a user must hold a website account on this domain. This information is retained in the local database. It is also possible to create events anonymously, if the site owner has this option enabled.'=>'Bitte beachte, dass zum Erstellen neuer Termine durch die Community-Events-Formular der Nutzer einen Online-Konto zu dieser Domain besitzen muss. Diese Informationen verbleiben in der lokalen Datenbank. Es ist auch möglich, Veranstaltungen anonym zu erstellen, wenn der Eigentümer der Website ist diese Option aktiviert hat.','Eventbrite Ticket information: name, description, cost, type, quantity'=>'Eventbrite Ticket-Informationen: Name, Beschreibung, Eintritt, Art, Menge','Import origin data (URL from where events are being imported—such as Eventbrite, MeetUp, other compatible URL sources, and more, which can include similar or same data as listed above)'=>'Importiere die Ursprungsdaten (URL, von der Veranstaltungen importiert werden, z. B. Eventbrite, MeetUp, andere kompatible URL-Quellen usw., die ähnliche oder dieselben Daten wie oben aufgeführt enthalten können.)','All data present within a CSV or ICS file and external URLs (for events, venues, organizers, and tickets)'=>'Alle vorhandenen Daten werden in einer CSV-oder ICS-Datei und externen URLs (für Events, Veranstaltungen, Veranstalter und Karten)','Importing Events, Venues, and Organizers:'=>'Importiere Veranstaltungen, Orte und Veranstalter:','Event information: website, cost, description, date, time, image'=>'Veranstaltungsinfo: Website, Eintritt, Beschreibung, Datum, Zeit, Bild','Organizer information: name, phone, website, email'=>'Veranstalter Info: Name, Telefon, Website, E-Mail','Venue information: name, address, city, country, state, postal code, phone, website, geographical coordinates (latitude and longitude)'=>'Veranstaltungsort Info: Name, Adresse, Stadt, Land, Bundesland, PLZ, Telefon, Website, Geo Koordinaten (Latitude und Longitude)','If you create, submit, import, save, or publish Event, Venue, or Organizer information, such information is retained in the local database:'=>'Wenn Du Veranstaltungs-, Veranstaltungsorte- oder Veranstalter-Informationen erstellen, übermitteln, importieren, speichern oder veröffentlichen werden diese in lokalen Datenbank gespeichert:','Suggested text:'=>'Empfohlener Text:','Through the usage of The Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets, and Community Events plugins, as well as our Event Aggregator Import service (contained within The Events Calendar plugin), information may be collected and stored within your website’s database.'=>'Durch die Nutzung von Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets und Community Events Plugins, sowie unser Event Aggregator-Import Service (enthalten im Events Calendar, Plugin) werden Daten erhoben und in der Datenbank Deiner Website gespeichert.','Event, Venue, and Organizer Information'=>'Veranstaltung, Ort und Veranstalter Informationen','What personal data we collect and why we collect it'=>'Welche persönlichen Daten wir sammeln und warum wir sie sammeln','This information is only for guidance and not to be considered as legal advice.'=>'Diese Informationen werden nur zur Orientierung und sind nicht als rechtliche Beratung.','Disclaimer:'=>'Haftungsausschluss:','You should include the information below in the correct sections of you privacy policy.'=>'Du solltest die folgenden Informationen in die richtigen Abschnitte Deiner Datenschutzrichtlinie einfügen.','This information serves as a guide on what sections need to be modified due to usage of The Events Calendar and its Add-ons.'=>'Diese Information dient als Leitfaden auf, welche Bereiche geändert werden müssen, durch die Nutzung des Veranstaltungskalenders und seinen Add-ons.','Hello,'=>'Hallo,','The default event category for events imported via Eventbrite'=>'Die Standard Veranstaltungskategorie für Veranstaltungen, die über Eventbrite importiert wurden','The default post status for events imported via Eventbrite'=>'Der Standardpoststatus für Veranstaltungen, die über Eventbrite importiert wurden','Eventbrite Import Settings'=>'Eventbrite-Import-Einstellungen','None'=>'Keiner','Import from Eventbrite'=>'Importiere von Eventbrite','Learn more'=>'Mehr erfahren','Do more with Eventbrite Tickets'=>'Mache mehr mit Eventbrite Tickets','An event having a post meta value of `%s` minutes is not valid. Make sure it is from 0 to 59.'=>'Eine Veranstaltung, welche einen Wert von `%s` Minuten hat, ist nicht gültig. Stelle sicher, dass er zwischen 0 und 59 liegt.','An event having a post meta value of `%s` hour (24-hour) is not valid. Make sure it is from 0 to 23.'=>'Eine Veranstaltung, welche einen post-meta-Wert von `%s` Stunden (24 Stunden) hat, ist nicht gültig. Stelle sicher, dass er zwischen 0 und 23 liegt.','An event having a post meta value of `%s` hour (12-hour) is not valid. Make sure it is from 1 to 12.'=>'Eine Veranstaltung, welche einen post-meta-Wert von `%s` Stunden (12 Stunden) hat, ist nicht gültig. Stelle sicher, dass er zwischen 0 und 12 liegt.','An event having a post meta value of `%s` hour (am/pm) is not valid. Make sure it is from 1 to 12.'=>'Eine Veranstaltung, welche einen post-meta-Wert von `%s` Stunden (am/pm) hat, ist nicht gültig. Stelle sicher, dass er zwischen 0 und 12 liegt.','An event having a post meta value of `%s` meridian is not valid. Make sure it is either `am` or `pm`, or remove it entirely if using the 24-hour format.'=>'Ein Veranstaltung, welche einen post-meta-Wert von `%s` meridian hat, ist nicht gültig. Stelle sicher, dass er entweder `am` oder `pm` ist, oder entferne ihn völlig, wenn Du das 24-Stunden-Format verwendest.','Refresh your connection to Eventbrite'=>'Verbindung zu Eventbrite aktualisieren','Connect to Eventbrite'=>'Mit Eventbrite verbinden','You need to connect to Eventbrite for Event Aggregator to work properly'=>'Du musst Dich mit Eventbrite verbinden, damit der Event Aggregator richtig arbeiten kann','Settings > General'=>'Einstellungen -> Allgemein','The number of events available in the preview may be limited by your %1$sImport Settings.%2$s'=>'Die Anzahl der in der Vorschau verfügbaren Veranstaltungen kann durch Deine %1$s Import-Einstellungen begrenzt sein.%2$s','to change how the actual time is displayed on your calendar.'=>'um zu ändern, wie die aktuelle Uhrzeit auf Deinem Kalender angezeigt wird.','timezone settings'=>'Zeitzonen Einstellungen','Events will be imported with the same timezone as defined on eventbrite.com. You can make use of The Events Calendar\'s'=>'Veranstaltungen werden mit der gleichen Zeitzone wie auf eventbrite.com definiert importiert. Du kannst Gebrauch machen des Events Calendars','Limited connectivity with Eventbrite'=>'Eingeschränkte Verbindung mit Eventbrite','link for connecting eventbriteConnect to Eventbrite'=>'Die Verbindung zu Eventbrite','You have not connected Event Aggregator to Eventbrite'=>'Der Event Aggregator ist nicht mit Eventbrite verbunden','Use the filters to narrow down which events are fetched from Eventbrite.'=>'Verwende die Filter, um einzugrenzen, welche Veranstaltungen von Eventbrite abgerufen werden.','Invalid Meetup URL'=>'Ungültige Meetup URL','Invalid Facebook URL'=>'Ungültige Facebook URL','Invalid Eventbrite URL'=>'Ungültige Eventbrite URL','eventbrite.com/e/example-12345'=>'eventbrite.com/e/example-12345','Import events directly from your connected Eventbrite.com account or from a public Eventbrite.com URL.'=>'Import events direkt von Deinem verbundenen Eventbrite.com Konto oder von einem öffentlichen Eventbrite.com URL.','Select Source'=>'Wähle Quelle','Import Source'=>'Importiere Quelle','Log into Eventbrite'=>'Bei Eventbrite anmelden','Please log in to enable event imports from Eventbrite.'=>'Bitte melde dich an, um den Import von Veranstaltungen aus Eventbrite zu aktivieren.','Import from your Eventbrite account'=>'Import von Deinem Eventbrite-Konto','One-time imports include all currently listed events, while scheduled imports automatically grab new events and updates from Eventbrite on a set schedule. Single events can be added via a one-time import.'=>'Einmalige Importe umfassen alle derzeit aufgelisteten Veranstaltungen, während geplante Importe automatisch neue Veranstaltungen und Aktualisierungen von Eventbrite nach einem festgelegten Zeitplan abrufen. Einzelne Veranstaltungen können über einen einmaligen Import hinzugefügt werden.','Please provide a Eventbrite URL when importing from Eventbrite.'=>'Bitte gebe eine Eventbrite-URL beim Import von Eventbrite an.','Successfully fetched Eventbrite Token'=>'Erfolgreich holte Eventbrite-Token','No upcoming Eventbrite events found.'=>'Es wurden keine anstehenden Eventbrite Veranstaltungen gefunden.','Events cannot be imported because Eventbrite has returned an error. This could mean that the event ID does not exist, the event or source is marked as Private, or the event or source has been otherwise restricted by Eventbrite. You can <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank">read more about Eventbrite restrictions in our knowledgebase</a>.'=>'Veranstaltungen können nicht importiert werden, da Eventbrite einen Fehler zurückgegeben hat. Dies kann bedeuten, dass die Veranstaltungs-ID nicht vorhanden ist, die Veranstaltung oder die Quelle als privat markiert ist oder die Veranstaltung oder die Quelle anderweitig von Eventbrite eingeschränkt wurde. <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank"> Weitere Informationen zu Eventbrite-Einschränkungen finden sich in unserer Knowledgebase </a>.','The new status message slug, to allow for localized messages.'=>'Der neue Status-Nachricht-Permalink, um lokalisierte Nachrichten