 URL, die Du in Deinen Google Kalender-Einstellungen benötigst.','Enter the url for the Google Calendar feed you wish to import.'=>'Gebe die URL für den Google Kalender-Feed ein, den Du importieren möchtest.','https://calendar.google.com/calendar/ical/example/basic.ics'=>'https://calendar.google.com/calendar/ical/example/basic.ics','One-time imports include all events in the current feed, while scheduled imports automatically grab new events and updates from the feed on a set schedule.'=>'Einmalige Importe umfassen alle Veranstaltungen im aktuellen Feed, während geplante Importe automatisch neue Veranstaltungen und Aktualisierungen aus dem Feed zu einem festgelegten Zeitplan erfassen.','Enter the url for a Facebook group or page. You can also enter the url of a single Facebook event.'=>'Gebe die URL für eine Facebook-Gruppe oder -Seite ein. Du kannst auch die URL einer einzelnen Facebook Veranstaltung eingeben.','facebook.com/example'=>'facebook.com/example','One-Time Import'=>'Einmaliger Import','Scheduled Import'=>'Geplanter Import','Log into Facebook'=>'Bei Facebook anmelden','Please log in to enable event imports from Facebook.'=>'Bitte melde Dich an, um Veranstaltungsimporte von Facebook zu ermöglichen.','Select how often you would like events to be automatically imported.'=>'Wähle aus, wie oft die Veranstaltungen automatisch importiert werden sollen.','Select Frequency'=>'Wähle Häufigkeit','One-time imports include all currently listed events, while scheduled imports automatically grab new events and updates from Facebook on a set schedule. Single events can be added via a one-time import.'=>'Einmalige Importe umfassen alle gegenwärtig aufgeführten Veranstaltungen, während geplante Importe automatisch neue Veranstaltungen und Updates von Facebook nach einem festgelegten Zeitplan erfassen. Einzelne Veranstaltungen können über einen einmaligen Import hinzugefügt werden.','Select Import Type'=>'Wähle Import Typ','Enter an Eventbrite event URL, e.g. https://www.ev