rt.'=>'Deine Vorschau enthält keine Datensätze, die importiert werden könnten.','Your import must include at least one event'=>'Dein Import muss mindestens eine Veranstaltung enthalten','Save Scheduled Import'=>'Speichere geplante Importe','Import Checked (%d)'=>'Import geprüft (%d)','Import All'=>'Importiere alle','Import All (%d)'=>'Importiere alle (%d)','There was an error fetching the results from your import:'=>'Es gab einen Fehler beim Abrufen der Ergebnisse aus Deinem Import:','The preview is taking longer than expected. Please try again in a moment.'=>'Die Vorschau dauert länger als erwartet. Bitte versuche es in einem Moment nochmal.','Meridian: pmPM'=>'PM','Meridian: amAM'=>'AM','Success! The settings from iCal Importer have been migrated to Event Aggregator. You can view your migrated imports on the Scheduled Imports tab.'=>'Die Einstellungen des iCal Importers wurden erfolgreich in den Event Aggregator importiert. Du kannst Deine migrierten Importe im Register Geplanten Importe anschauen.','We did not find any iCal Importer settings to migrate.'=>'Es wurden keine iCal Importer Einstellungen gefunden, die migriert werden könnten.','You do not have permission to migrate iCal Importer settings to Event Aggregator'=>'Du bist nicht berechtigt, die Einstellungen von iCal Importer auf Event Aggregator zu migrieren','Error: we were not able to migrate your iCal Importer settings to Event Aggregator. Please try again later.'=>'Fehler: Deine iCal Importer-Einstellungen konnten nicht auf Event Aggregator migriert werden. Bitte versuche es später erneut.','Success! The settings from Facebook Events have been migrated to Event Aggregator. You can view your migrated imports on the Scheduled Imports tab.'=>'Erfolgreich abgeschlossen! Die Einstellungen von Facebook Events wurden zu Event Aggregator migriert. Du kannst Deine migrierten Importe auf der Registerkarte Geplante Importe anzeigen.','We did not find any Facebook Events settings to migrate.'=>'Es wurden keine 