rder to perform a CSV import.'=>'Du musst Spalten aus der CSV-Datei bestimmten Feldern zuordnen, um einen CSV-Import durchzuführen.','There may be an issue with the Event Aggregator server. Please try your import again later.'=>'Möglicherweise liegt ein Problem mit dem Event Aggregator-Server vor. Bitte versuche den Import später erneut.','You must enter an Event Aggregator license key in Events > Settings > Licenses before using this service.'=>'Du musst einen Event Aggregator Lizenzschlüssel in Veranstaltungen > Einstellungen > Lizenzen eingeben, bevor du diesen Dienst verwenden können.','Unable to get a post of the correct type.'=>'Ein Beitrag des richtigen Typs konnte nicht abgerufen werden.','The import record is missing the origin.'=>'Die Quelle des Importdatensatz fehlt.','Unable to find a matching post.'=>'Es konnte kein passender Beitrag gefunden werden.','An invalid frequency was used when trying to create this scheduled import.'=>'Beim Versuch, diesen geplanten Import zu erstellen, wurde eine ungültige Häufigkeit verwendet.','Unable to attach an image to the event'=>'Ein Bild kann nicht an die Veranstaltung angehängt werden','Unable to find an import record with the ID of %s.'=>'Es konnte kein Importdatensatz mit der ID von %s gefunden werden.','The Event Aggregator API responded with bad data. Please <a href="https://theeventscalendar.com/support/post/" target="_blank">contact support</a>.'=>'Die Aggregator-API reagierte mit fehlerhaften Daten. Bitte <a href="https://theeventscalendar.com/support/post/" target="_blank">kontaktiere den Support</a>.','Unable to find an event with the ID of %s.'=>'Es wurde keine Veranstaltung mit der ID von %s gefunden.','Only scheduled import records can be edited.'=>'Nur geplante Import Datensätze können gelöscht werden.','Invalid data provided for CSV import.'=>'Es wurden ungültige Daten für den CSV Import bereitgestellt.','You must provide a valid CSV file to perform a CSV import.'=>'Du musst eine gültige CSV Datei bere