eine Anfrage in unserem %s stellen. Unser Support Team prüft diese Foren einmal wöchentlich und hilft Dir gerne weiter','open-source forum on WordPress.org'=>'Open Source Forum auf WordPress.org','<strong>Looking for more immediate support?</strong> We offer %s with the purchase of any of our premium plugins. Pick up a license and you can post there directly and expect a response within 24-48 hours during weekdays'=>'<strong>Benötigst Du eine schnellere Unterstützung?</strong> Wir bieten %s mit dem Kauf eines unserer Premium Plugins. Wähle eine Lizenz und du kannst dort direkt Deine Frage stellen und erhältst wochentags innerhalb von 24-48 Stunden eine Antwort','premium support on our website'=>'Premium Support auf unserer Website','If you have tried the above steps and are still having trouble, you can post a new thread to our WordPress.org forums for %1$s or %2$s. Our support staff monitors these forums once a week and would be happy to assist you there. '=>'Wenn Du die Schritte oben schon versucht und immer noch Probleme hast, kannst Du eine Anfrage in unseren WordPress.org Foren für %1$s und %2$s einstellen. Unser Support Team überprüft diese Foren einmal wöchentlich und hilft Dir gerne weiter. ','Events Tickets'=>'Events Tickets','Customizing the Events plugins'=>'Die Veranstaltung Plugins anpassen','%s: Code and guides for customizing your calendar in useful and interesting ways.'=>'%s: Code und Anleitungen, um Deinen Kalender auf sinnvolle und interessante Weise anzupassen','Troubleshooting common problems'=>'Lösung allgemeiner Probleme','%s: Do you see an issue with your calendar? Go here first to find where it’s coming from and how to fix it.'=>'%s: Hast Du einen Fehler in unserem Kalender entdeckt? Klicke hier um herauszufinden, woher er kommt und wie er gelöst werden kann.','Using stylesheets and page templates'=>'Nutze Stylesheets und Seitenvorlagen','%s: An overview of the default templates and styles that are included in the plugin, as well as how to change them.'=>'%s: Ein Überblick über die Standard Vorlagen und Designs, welche im Plugin enthalten sind und wie man diese anpassen kann.','%s: Our most comprehensive outline for customizing the calendar to suit your needs, including custom layouts and styles.'=>'%s: Unsere umfassendste Anleitung, um den Kalender an Deine Bedürfnisse anzupassen, inklusive individuellen Layouts und Designs.','Features overview'=>'Übersicht der Features','%s: A complete look at the features you can expect to see right out of the box as well as how to use them.'=>'%s: Eine komplette Übersicht der Funktionen, welche dich erwarten und wie sie benutzt werden können.','Settings overview'=>'Einstellungsübersicht','%s: A thorough walkthrough of The Events Calendar and the settings that are available to you.'=>'%s: Eine umfassender Überblick des Events Calendar und seiner Einstellungen sind für dich verfügbar.','Support for The Events Calendar'=>'Unterstützung für The Events Calendar','We are committed to helping make your calendar spectacular and have a wealth of resources available, including a handy %s to get your calendar up and running.'=>'Wir möchten, dass Dein Kalender spektakulär wird und haben viele Hilfdmittel dafür verfügbar, inklusive praktische %s, um Deinen Kalender in Gang zu bringen.','New User Primer'=>'Primer für neue Nutzer','CSV Import Settings'=>'CSV Import Einstellungen','Clear'=>'Leeren','Add another %s'=>'Weitere %s hinzufügen','Create New %s'=>'Neue %s erstellen','Unnamed %s'=>'Unbenannte(r) %s','Read more about our support policy'=>'Erfahre mehr über unsere Support Richtlinien','Please note that all hands-on support is provided via the help desk. You can email or tweet at us… ​but we will probably point you back to the help desk 😄'=>'Bitte beachte, dass jeglicher Support über das Forum erfolgt. Du kannst uns mailen oder tweeten ... aber wir werden Dich wieder auf das Forum verweisen 😄','%s. There are very few issues we haven’t seen and it’s likely another user has already asked your question and gotten an answer from our support staff. While posting to the help desk is open only to paid customers, they are open for anyone to search and review.'=>'%s. Es gibt wenige Probleme, welche wir noch nicht gesehen haben und es ist sehr wahrscheinlich, dass Deine Frage schon gestellt und von unserem Supportpersonal beantwortet wurde. Auch wenn neue Fragen nur durch zahlende Kunden gestellt werden können, kann es von jedem durchsucht und angeschaut werden.','Test for a theme or plugin conflict'=>'Auf einen Theme oder Plugin Konflikt prüfen','%s. Testing for an existing conflict is the best start for in-depth troubleshooting. We will often ask you to follow these steps when opening a new thread, so doing this ahead of time will be super helpful.'=>'%s. Die Prüfung auf einen bestehenden Konflikt ist der beste Anfang für eine gründliche Fehlersuche. Wir werden Dich in der Regel bitten, diese Schritte zu befolgen, wenn Du einen Thread eröffnest.','Check our Knowledgebase'=>'Knowledgebase besuchen','%s. All of the common (and not-so-common) answers to questions we see are here. It’s often the fastest path to finding an answer!'=>'%s. Alle allgemeinen (und weniger allgemeinen) Antworten auf Fragen sind hier zu finden. Meist ist es der schnellste Weg um eine Antwort zu finden!','While the resources above help solve a majority of the issues we see, there are times you might be looking for extra support. If you need assistance using our plugins and would like us to take a look, please follow these steps:'=>'Während die Hilfsmittel oben eine Vielzahl von Problemen, die wir kennen, lösen, wird manchmal zusätzlicher Support benötigt. Wenn Du Unterstützung beim Nutzen unserer Plugins benötigst und wir helfen sollen, folge bitte diesen Schritten:','Getting More Help'=>'Mehr Unterstützung bekommen','list of available functions'=>'Liste der verfügbaren Funktionen','Knowledgebase'=>'Wissens-Datenbank','Our website’s %s is a great place to find tips and tricks for using and customizing our plugins.'=>'Das %s auf unserer Website ist ein großartiger Ort, um Tipps und Tricks und Infos über das Anpassen unserer Plugins zu finden.','Getting Support'=>'Unterstützung erhalten','Thank you for using %s! All of us at The Events Calendar sincerely appreciate your support and we’re excited to see you using our plugins.'=>'Danke, dass Du %s nutzt! Wir von The Events Calendar freuen uns über Deine Unterstützung und dass Du unsere Plugins nutzt.','Thanks for setting up a valid key. It will expire on %s'=>'Danke für das Bereitstellen eines gültigen Lizenzschlüssels. Er läuft am %s aus','Visit the Add-on Page'=>'Add-On Seite besuchen','Plugin Inactive'=>'Plugin inaktiv','Plugin Active'=>'Plugin aktiv','Rating:'=>'Bewertung:','Active Users:'=>'Aktive Nutzer:','Install Plugin'=>'Plugin installieren','Install %s'=>'Installiere %s','Upgrade Plugin'=>'Plugin upgraden','Activate Plugin'=>'Aktiviere dieses Plugin','Activate %s'=>'%s aktivieren','Community Tickets'=>'Community Tickets','Event Tickets Plus'=>'Event Tickets Plus','Facebook Events'=>'Facebook Events','Eventbrite Tickets'=>'Eventbrite Tickets',' and '=>' und ','Turbo charge your posts admin for any custom post type with sortable filters and columns, and auto-registration of metaboxes.'=>'Versehe deine benutzerdefinierten Inhaltstypen (Custom Post Types) mit sortierbaren Filtern und Spalten und Auto-Registrierung von Metaboxen.','Advanced Post Manager'=>'Advanced Post Manager','Events Tickets is a carefully crafted, extensible plugin that lets you easily sell tickets for your events.'=>'Events Tickets ist ein sorgfältig entwickeltes, erweiterbares Plugin, mit welchem Du einfach Tickets zu Deiner Veranstaltung verkaufen kannst.','Event Tickets'=>'Event Tickets','The Events Calendar is a carefully crafted, extensible plugin that lets you easily share your events.'=>'The Events Calendar ist ein sorgfältig entwickeltes, erweiterbares Plugin, mit welchem du einfach deine Veranstaltungen teilen kannst.','Completed!'=>'Abgeschlossen!','organizers'=>'Veranstalter','Event ID'=>'Veranstaltungs-ID','Cancel'=>'Abbrechen','%s must be a positive number or percent.'=>'%s muss eine positive Zahl oder ein Prozentwert sein.','%1$s or %2$s'=>'%1$s von %2$s','The Events Calendar is a carefully crafted, extensible plugin that lets you easily share your events. Beautiful. Solid. Awesome.'=>'The Events Calendar ist ein sorgfältig entwickeltes, erweiterbares Plugin, mit welchem du einfach deine Veranstaltungen teilen kannst. Schön. Solide. Fantastisch.','%s Navigation'=>'%s Navigation','%s Tags:'=>'%s-Tags:','Find %s'=>'Suche %s','Import complete!'=>'Import abgeschlossen!','Import Type:'=>'Import Typ:','Events Import'=>'Import Veranstaltungen','%1$s from %2$s'=>'%1$s von %2$s','Past %s'=>'Vergangene %s','%1$s for %2$s - %3$s'=>'%1$s f&uuml;r %2$s - %3$s','Upcoming %s'=>'Anstehende %s','+ Google Map'=>'Google Karte anzeigen','Click to view a Google Map'=>'Klicken, um Google Karte anzuzeigen','Loading %s'=>'Lade %s','Tags:'=>'Schlagworte:','category list label%s Category'=>'%sskategorie' . "\0" . '%sskategorien','Category'=>'Kategorie','The function needs to be passed an $event or used in the loop.'=>'Diese Funktion muss einen $event übergeben oder in einer Schleife verwendet werden.','%s:'=>'%s:','Origin:'=>'Quelle:','Details'=>'Details','Postal Code:'=>'PLZ:','Select a State:'=>'Bundesstaat wählen:','State or Province:'=>'Bundesland / Kanton:','Country:'=>'Land:','City:'=>'Ort:','Appends the time zone to the end of event scheduling information &ndash; this can be useful when you have events in numerous different time zones.'=>'Fügt die Zeitzone zur Veranstaltungszeit hinzu; dies kann nützlich sein, wenn es Veranstaltungen in unterschiedlichen Zeitzonen gibt.','Show time zone'=>'Zeitzone anzeigen','Use the site-wide time zone everywhere'=>'Nutze nur eine Zeitzone für die gesamten Website','Use manual time zones for each event'=>'Nutze mehrere Zeitzonen für die Website','Time zone mode'=>'Zeitzonen Modus','Click this button to update your database and take advantage of additional time zone capabilities. Please <a href="%s" target="_blank">configure WordPress</a> to use the correct time zone before clicking this button!'=>'Klicke diesen Button an, um mehrere Zeitzonen (u.a. im Formular für die Übermittlung von neuen Veranstaltungen) in Deinem Kalender zu nutzen. Bitte <a href="%s" target="_blank">konfiguriere in WordPress</a> die korrekte Zeitzone, bevor Du diesen Button anklickst!','Update Time Zone Data'=>'Mehrere Zeitzonen aktivieren','Enable Time Zone support'=>'Zeitzonen-Unterstützung aktivieren','Hide the following settings tabs on every site:'=>'Blende die folgenden Reiter auf jeder Website aus:','This is where all of the global network settings for The Events Calendar can be modified.'=>'Hier werden alle Netzwerkeinstellungen für den The Events Calendar eingestellt.','Network Settings'=>'Netzwerkeinstellungen','News and Tutorials'=>'Neuigkeiten und Tutorials','Premium Add-Ons'=>'Premium Add-Ons','WordPress '=>'WordPress ','Requires:'=>'Benötigt:','Latest Version:'=>'Neueste Version:','More...'=>'Mehr …','Events Calendar PRO'=>'Events Calendar PRO','You are up to date!'=>'Du bist auf dem neuesten Stand!','You need to upgrade!'=>'Du musst aktualisieren!','not availablen/a'=>'n/a','Debug Bar Plugin'=>'Debug Bar Plugin','Debug mode'=>'Debug-Modus','Merge duplicate Venues &amp; Organizers'=>'Doppelte Veranstaltungsorte und Veranstalter zusammenführen','0 = zoomed out; 21 = zoomed in.'=>'0 = maximal herausgezoomt, 21 = maximal hineingezoomt.','Google Maps default zoom level'=>'Google Maps Standard Zoomstufe','Check to enable maps for events and venues.'=>'Aktivieren, um Veranstaltungen und Veranstaltungsorte in einer Karte anzuzeigen.','The currency symbol normally precedes the value. Enabling this option positions the symbol after the value.'=>'Die Währung ist normalerweise dem Betrag vorangestellt. Durch Aktivieren dieser Option wird die Währung hinter dem Betrag angezeigt.','Currency symbol follows value'=>'Währung nach dem Betrag anzeigen','Set the default currency symbol for event costs. Note that this only impacts future events, and changes made will not apply retroactively.'=>'Lege die Standard Währung für die Veranstaltungspreise fest. Bitte beachte, dass dies nur zukünftige Veranstaltungen betrifft und keine vergangene Veranstaltungen beeinflußt.','Default currency symbol'=>'Standard Währung','Have an event that runs past midnight? Select a time after that event\'s end to avoid showing the event on the next day\'s calendar.'=>'Hast du Veranstaltungen, die nach Mitternacht enden? Wähle eine Zeit nach dem Veranstaltungsende, um zu vermeiden, dass die Veranstaltung im Kalender des nächsten Tages angezeigt wird.','End of day cutoff'=>'Neuer Tag ab','Single event URL slug'=>'Permalink für einzelne Veranstaltungen','Here is the iCal feed URL for your events:'=>'Hier befindet sich die iCal Feed URL für Deine Veranstaltungen:','Events URL slug'=>'Permalink für alle Veranstaltungen','Show events with the site\'s other posts. When this box is checked, events will also continue to appear on the default events page.'=>'Veranstaltungen gemeinsam mit anderen Beiträgen anzeigen. Wenn diese Option gewählt ist, werden Veranstaltungen trotzdem auf der Standard Veranstaltungsseite weiter angezeigt.','Include events in main blog loop'=>'Veranstaltungen in Blog Loop integrieren','Enable comments on event pages.'=>'Kommentare auf den Veranstaltungsseiten aktivieren.','Show comments'=>'Kommentare anzeigen','Number of events to show per page'=>'Anzahl der Veranstaltungen pro Seite','Show The Events Calendar link'=>'Den Link zum Veranstaltungskalender anzeigen','Looking for additional functionality including recurring events, custom meta, community events, ticket sales and more?'=>'Wünschst du Dir erweiterte Funktionalität, einschließlich wiederkehrender Veranstaltungen, benutzerdefinierten Meta-Informationen, Community-Veranstaltungen, Ticketverkäufen und mehr?','Right here'=>'Genau hier','Where\'s my calendar?'=>'Wo ist mein Kalender?','Finding your calendar.'=>'Deinen Kalender finden.','Finding & extending your calendar.'=>'Deinen Kalender finden und erweitern.','If you are familiar with HTML, you can add additional code after the event template. Some themes may require this to help with styling or layout.'=>'Wenn Du mit HTML vertraut bist, kannst Du Code NACH der Veranstaltungsvorlage einfügen. Bei einigen Themes kann dies für Anpassungen am Layout und Design notwendig sein.','Add HTML after event content'=>'Folgender HTML-Code wird NACH der Veranstaltung hinzugefügt','If you are familiar with HTML, you can add additional code before the event template. Some themes may require this to help with styling or layout.'=>'Wenn Du mit HTML vertraut bist, kannst du Code VOR der Veranstaltungsvorlage einfügen. Bei einigen Themes kann dies für Anpassungen am Layout und Design notwendig sein.','Add HTML before event content'=>'Folgender HTML-Code wird VOR der Veranstaltung hinzugefügt','Enter the separator that will be used between the start and end time of an event.'=>'Gib bitte das Trennzeichen ein, das die Start- und Ende Uhrzeit einer Veranstaltung trennt.','Time range separator'=>'Zeitraum Trennzeichen','Enter the separator that will be placed between the date and time, when both are shown.'=>'Gib bitte das Trennzeichen ein, das Datum und Uhrzeit trennt, wenn beides angezeigt wird.','Date time separator'=>'Datum Zeit Trennzeichen','Enter the format to use for dates that show a month and year only. Used on month view. Example: %1$s'=>'Bitte das Format für die Anzeige eines Datums festlegen, bei dem nur der Monat und das Jahr angezeigt wird. Wird bei der Monatsansicht verwendet. Beispiel: %1$s','Month and year format'=>'Monat und Jahr Format','Enter the format to use for displaying dates without a year. Used when showing an event from the current year. Example: %1$s'=>'Bitte das Format eingeben, das für die Anzeige eines Datum ohne Jahresangabe verwendet werden soll. Wird benutzt, wenn eine Veranstaltung für das aktuelle Jahr angezeigt wird. Beispiel: %1$s','Check this to cache your month view HTML in transients, which can help improve calendar speed on sites with many events. <a href="%s" rel="noopener" target="_blank">Read more</a>.'=>'Aktiviere diese Option, um HTML der Monatsansicht zu cachen. Dies kann helfen, die Geschwindigkeit des Kalenders auf Websiten mit vielen Veranstaltungen zu erhöhen. <a href="%s" rel="noopener" target="_blank">Mehr lesen</a>.','Enable the Month View Cache'=>'Den Cache für die Monatsansicht aktivieren','Month view events per day'=>'Monatsansicht - Veranstaltungen pro Tag','Disable the event search bar'=>'Veranstaltungssuchleiste deaktivieren','Default view'=>'Standardansicht','You must select at least one view.'=>'Es muss mindestens eine Ansicht gewählt werden.','Enable event views'=>'Veranstaltungsansicht wählen','Events template'=>'Veranstaltungsvorlage','A fully designed and styled theme for your events pages.'=>'Ein komplett designtes Theme für Deine Veranstaltungsseite.','Only includes enough css to achieve complex layouts like calendar and week view.'=>'Enthält nur Basis CSS Angaben, um Layouts wie den Kalender oder die Wochenansicht darzustellen.','Skeleton Styles'=>'Skeleton Style','Default stylesheet used for events templates'=>'Standard Stylesheet für die Veranstaltungsansicht','Default Page Template'=>'Standard-Seitenvorlage (WordPress)','Default Events Template'=>'Standard Veranstaltungsvorlage','Select an image'=>'Bild auswählen','View'=>'Ansehen','Edit'=>'Bearbeiten','Address:'=>'Adresse:','%s Name Already Exists'=>'%s Name existiert bereits','Email:'=>'E-Mail:','Website:'=>'Webseite:','Phone:'=>'Telefon:','%s Name:'=>'%s-Name:','Enter a 0 for %s that are free or leave blank to hide the field.'=>'Bitte 0 eingeben f&uuml;r %s, die kostenlos sind oder leer lassen, um das Feld auszubl